script: |
  super -f tsv -I q768.sql | sort > q768.out

inputs:
  - name: q768.sql
    data: |
      SELECT ALL - 85 * col0 + col2 AS col1 FROM tab0 WHERE ( - 84 * - + ( + col2 ) ) NOT BETWEEN + col0 * + - 30 AND + col1 + + ( + col2 );
  - name: tab0

outputs:
  - name: q768.out
    data: |
      -1228
      -7385
      -8146
